import React, { useState } from "react";
import { AiFillCaretLeft, AiFillCaretRight } from "react-icons/ai";

const Projects = () => {
  const [projects, setProjects] = useState("AHSAN");
  return (
    <div className="projects">
      <h1>Projects</h1>
      {projects}
      <button>
        <AiFillCaretLeft />
      </button>
      <button>
        <AiFillCaretRight />
      </button>
    </div>
  );
};

export default Projects;
